function toggleNav(){toggleExpanded($("nav.gouda-nav-tree"));$("gouda-nav-group[aria-expanded='true']").attr("aria-expanded","false")}function toggleExpanded(n){$(n).attr("aria-expanded")==="true"?collapseElement(n):expandElement(n)}function expandElement(n){$(n).attr("aria-expanded","true")}function collapseElement(n){$(n).attr("aria-expanded","false")}function toggleNavGroup(n){var t=$(n.currentTarget).parent();toggleExpanded(t)}function getFunctionPointer(n){return window[n]}function wireInputs(){wireIPAddressValidity();wireFormSubmissionSuppression()}function wireIPAddressValidity(){$("gouda-input .IPAddress").on("input",function(){this.validity.patternMismatch?this.setCustomValidity("Please supply an IP Address."):this.setCustomValidity("")})}function wireFormSubmissionSuppression(){$("form.gouda-form").submit(function(n){n.preventDefault()})}function extractDestination(n){var t=$(n).data("destination"),i=$(n).data("method");return{url:t,method:i}}function extractForm(n){var t=n.serializeArray(),r={};for(i=0;i<t.length;i++)r[t[i].name]=t[i].value;return r}$(document).ready(function(){$("#nav-toggle").click(toggleNav)});$(document).ready(function(){$("gouda-nav-group .header").click(toggleNavGroup)});$(document).ready(function(){wireInputs()});